import router from '@ohos.router'

@Entry
@Component
export default struct Home {
  @State index: number = 0
  @State menuOpacity:number = 0


  onPageHide(){
    this.menuOpacity = 0
  }



  @Builder NavigationMenus() {
    Row() {
      Image('/images/we_add.png')
        .size({ width: 24, height: 24 })
        .margin({ left: 5 })
        .onClick(()=>{
          animateTo({
            duration: 200,
          }, () => {
            if(this.menuOpacity == 0){
              this.menuOpacity = 1
            }else if(this.menuOpacity == 1){
              this.menuOpacity = 0
            }

          })
        })
    }.justifyContent(FlexAlign.End)
  }

  @Builder NavigationTitle() {
    Row(){
      Text("微信")
        .width('100')
    }
    .width('100%')
    .justifyContent(FlexAlign.Center)
  }






  build() {
    Column() {
      Navigation(){

        Stack({alignContent:Alignment.TopEnd}){

          Column(){
            TextInput({ placeholder: '搜索' })
              .width('92%')
              .height(40)
              .backgroundColor(Color.White)
              .margin(0)
              .borderRadius(5)
              .textAlign(TextAlign.Center)

            List(){

              ListItem(){
                MessageRow({imagePath:'/images/icon1.png',nickName:'猪头',messageContent:'燕子你走了我可怎么活啊燕子～～～～燕子～～～～',messageTime:'12:13'})
              }
              .onClick(()=>{
                router.pushUrl({url:'pages/Home/Chat'})
              })

              ListItem(){
                MessageRow({imagePath:'/images/icon2.png',nickName:'老张',messageContent:'欢迎关注幽蓝计划公众号',messageTime:'12:13'})
              }
              .onClick(()=>{
                router.pushUrl({url:'pages/Home/Chat'})
              })

              ListItem(){
                MessageRow({imagePath:'/images/icon3.png',nickName:'王富贵',messageContent:'你猜这是为什么',messageTime:'12:13'})
              }
              .onClick(()=>{
                router.pushUrl({url:'pages/Home/Chat'})
              })

            }
            .divider({ strokeWidth: 2, color: 'rgb(247,247,247)', startMargin: 60, endMargin: 0 }) // 每行之间的分界线
            .margin({top:17})
            .padding({left:17,right:17})
            .backgroundColor(Color.White)
            .height('100%')
          }

            Flex({direction:FlexDirection.Column,justifyContent:FlexAlign.Center}){
              Path()
                .width(20)
                .height(20)
                .commands('M25 0 L50 50 L0 50 Z')
                .fill('rgb(76,76,76)')
                .stroke('rgb(76,76,76)')
                .padding(0)
                .margin(0)
                .position({x:95,y:0})

              List(){
                ListItem(){
                  MenuRow({imagePath:'/images/menu_group.png',titleString:'发起群聊'})
                }
                ListItem(){
                  MenuRow({imagePath:'/images/menu_add.png',titleString:'添加朋友'})
                }
                ListItem(){
                  MenuRow({imagePath:'/images/menu_scan.png',titleString:'扫一扫'})
                }
                ListItem(){
                  MenuRow({imagePath:'/images/menu_purchase.png',titleString:'收付款'})
                }
              }
              .margin(0)
              .borderRadius(5)

              .padding({left:12})
              .divider({ strokeWidth: 1, color: 'rgb(130,130,130)', startMargin: 20, endMargin: 0 }) // 每行之间的分界线
              .backgroundColor('rgb(76,76,76)')
              .width(130)
              .height(180)

            }
            .opacity(this.menuOpacity)
            .width(130)
            .height(200)
            .margin({right:10,top:-10})
        }

      }
      .title(this.NavigationTitle())
      .mode(NavigationMode.Stack)
      .titleMode(NavigationTitleMode.Mini)
      .hideBackButton(true)
      .menus(this.NavigationMenus())
      .size({ width: '100%', height: '100%' })
      .backgroundColor('rgb(237,237,237)')
    }
    .width('100%')
    .height('100%')
  }
}

