                ContactsRow({imagePath:'/images/contact_3.png',titleString:'标签'})


              }

              ListItem(){
                ContactsRow({imagePath:'/images/contact_4.png',titleString:'公众号'})


              }

              ListItem(){
                ContactsRow({imagePath:'/images/contact_5.png',titleString:'企业微信联系人'})


